import './App.css';
import React, { useState, useEffect } from 'react';
import data from './data/data.json';

function App() {


  useEffect(() => {
    getData();
  }, []);

  // convert JSON data into 2 arrays
  // let dataArr = Object.entries(getData)

  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/create">
              <Create />
            </Route>
            <Route path="/blogs/:id">
              <BlogDetails />
            </Route>
            <Route path="*">
              <NotFound />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );

}

export default App;
